import React from 'react'

class MyCount extends React.Component {
  state = {
    count: 0
  }
  componentDidMount() {
    setInterval(() => {
      this.setState({ count: this.state.count + 1 })
    }, 1000)
  }
  render () {
    return <span>{ this.state.count }</span>
  }
}

export default MyCount
